import { getJSON } from "../APIHelpers";

const URI = "http://127.0.0.1:8000";
export const getSimple = async (name) => {
    console.log('calling');
    const response = await getJSON(`${URI}/simple/${name}`);
    console.log(response);
    return response;
};
